  false,\n\t\"url\": null,\n\t\"notes\": \"This data set is a polyline file of mapped
  ShoreZone units which correspond with data records found in the Unit, Xshr, BioUnit,
  and BioBand tables of this Geodatabase. Linkage between spatial and attribute data
  table is through a unique physical identifier in the PHY_IDENT field. Basic definitions
  of table fields are provided in this metadata, but the user is referred to the \"lookup\"
  and \"definition\" tables in the ShoreZone Coastal Habitat Mapping Protocol (2008)
  available online at ShoreZone.org or at CoastalAndOceans.com. ShoreZone is a coastal
  habitat mapping and classification system in which georeferenced aerial imagery
  is collected specifically for the interpretation and integration of geomorphic and
  biological features of the intertidal zone and nearshore environment. Oblique low-altitude
  aerial video and digital still imagery of the coastal zone is collected during the
  lowest tides of the year, usually from a helicopter flying at or below 100 m altitude.
  During image collection, the aircraft's GPS position is continuously recorded so
  that the video and still imagery have positional information. Video imagery is accompanied
  by continuous, simultaneous commentary by a geologist and a biologist aboard the
  aircraft. The imagery and commentary are used in the definition of discrete along-shore
  coastal habitat units and the mapping of observed physical, geomorphic, sedimentary,
  and biological across-shore components within those units. Units are digitized as
  shoreline segments in ArcGIS, then integrated with the along-shore and across-shore
  geological and biological data attribute tables housed in the geodatabase. Mapped
  habitat features include degree of wave exposure, substrate type, sediment texture,
  intertidal biota, and some nearshore subtidal biota.\",\n\t\"license_title\": null,\n\t\"extras\":
