  \"progress\",\n\t\t\"value\": \"onGoing\"\n\t},\n\t{\n\t\t\"key\": \"access_constraints\",\n\t\t\"value\":
  \"[\"Access Constraints: The ShoreZone Program is a partnership of public, private,
  and governmental agencies. Protocols for data access and distribution are established
  by the program partner agencies. Please see ShoreZone.org or CoastalAndOceans.com
  for a list of partner agencies and related web sites. Video imagery can be viewed
  and digital stills downloaded online at www.alaskafisheries.noaa.gov/shorezone/.
  Any hardcopies or published data sets utilizing ShoreZone products shall clearly
  indicate their source. Please refer to \"Data Quality\" metadata for information
  on attribute accuracy. To ensure distribution of the most current public information
  or for correct interpretation, contact the ShoreZone project manager or GIS specialist
  at Coastal and Ocean Resources, Inc. | Use Constraints: To effectively and appropriately
  use ShoreZone data, the user shall refer to the ShoreZone Coastal Habitat Mapping
  Protocol (2008) available at ShoreZone.org and at www.CoastalAndOceans.com. Data
  provided are derived from large, regional databases that are continually being updated
  and modified. The accuracy of some information is subject to change. Any published
  data sets utilizing ShoreZone products (printed, digital, or online) shall clearly
  indicate their source. If the user has modified the data in any way, the user is
  obligated to describe the types of modifications performed. The user specifically
  agrees not to misrepresent these data, nor to imply that changes made were approved
  by the ShoreZone program or its partners. Please refer to \"Data Quality\" metadata
  for information on attribute accuracy. | Distribution Liability: Not for navigationnnAccess
